import React from 'react';
import {BrowserRouter,Switch,Route} from 'react-router-dom';
import Profiler from './pages/Profile';
import Logon from './pages/Logon';
import New from './pages/newInsidents'
import Register from './pages/Registre';
export default function Routes(){
   return (
       <BrowserRouter>
       <Switch>
           <Route path="/" exact component={Logon}/>
           <Route path="/registre" component={Register}/>
           <Route path="/profiler" component={Profiler}/>
           <Route path="/Insidents/new" component={New}/>
       </Switch>
       
       </BrowserRouter>
   );


}
